export function getIcons(iconsId) {
  /*
  Dynamic Import with improved performance.
  Macros are used to avoid bundling unnecessary modules.
   Similar to this code
  ```
  return import(`react-icons/${iconsId}/index`);
  ```
  */
  return fn(iconsId);
